import React from 'react';
import 'isomorphic-fetch';

import api from '../services/api';

const Home = () => {
  return (
    <div>
      Home
    </div>
  )
};

Home.getInitialProps = async () => {
  const response = await api.get('/pokemon');
  console.log(response.data);

  return {};
}

export default Home;
